import React from 'react'

const Child = ({country}) => {

    console.log("country values",country)

  return (
    <>
    <ul>
    {
        country.map((a,index)=>{
            return(
                <> 
                <li>{a}</li>

                </>
            )
        })
    }
    </ul>
    </>
  )
}

export default Child
